('81', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Привлекательный Samsung GALAXY S4 mini обладает практически всеми возможностями флагманского смартфона Samsung GALAXY S4 при своих компактных размерах, за счет которых его очень удобно носить с собой и управлять им одной рукой. Качественный карбоновый корпус, представленный в множестве цветовых решений, удовлетворит любого пользователя. Яркий дисплей с диагональю 4,3 дюйма гарантирует более чистое и четкое изображение. Смартфон Samsung GALAXY S4 mini поможет тебе в любой ситуации. Что бы ни случилось, с помощью этого смартфона ты сможешь быстро и легко решить практически любые задачи и все это благодаря его техническим возможностям. Внушительный объем памяти, камеры высокой четкости и различные возможности подключения придадут тебе уверенности и превратят рутину в интересное приключение.'),
