('80', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Galaxy Note 4 — это наследник знаменитого фаблета Note 3 от Samsung, который получил минималистичный дизайн со стильной металлической рамкой, усовершенствованную аппаратную платформу и улучшенное интуитивное управление с помощью нового стилуса S-Pen.'),
