('75', '65209415-3fdb-410e-89a5-fc5f0f08b938', '«Сердцем» iPhone 4S является двухъядерный процессор Apple A5, известный по iPad 2, который обладает в несколько раз более производительной графической подсистемой, обеспечивая возможность создания игровых приложений со сложными и насыщенными сценами. Несмотря на сохранившийся внешний вид, стальная антенна-ободок теперь разделена на две части, причём телефон обладает механизмом автоматического выбора той части антенны, которая в данный момент лучше подходит для приёма/передачи. Среди других особенностей коммуникационной части смартфона выделяются Bluetooth 4.0, увеличенная до 14,4 Мбит/с скорость передачи данных в сотовых сетях и использование чипсета, позволяющего iPhone 4S работать как в GSM, так и в CDMA-сетях. Восьмимегапиксельная камера, оснащённая датчиком с обратной засветкой, инфракрасным фильтром и объективом с пятью линзами. По словам Apple, при разработке iPhone 4S ставилась цель добиться качества снимков, сопоставимого с качественными компактными фотоаппаратами («мыльницами»).На съемку первого кадра уйдет 1,1 с, каждый последующий кадр iPhone 4S может снимать за 0,5 c. Камера также позволяет снимать видео с разрешением 1080p.'),
