('59', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Смартфон Apple iPhone 6 с экраном диагональю 4.7 дюйма и разрешением 1334x750 пикселей. Смартфон получил 20-нанометровый процессор Apple A8 и 64 ГБ встроенной памяти, 8-мегапиксельную основную камеру и iOS 8 в качестве операционной системы. Толщина iPhone 6 — 6,9 мм. Apple iPhone 6 работает до 250 часов в режиме ожидания и до 14 часов в режиме разговора. Отдельная заслуга в этом энергоэффективного процессора А8.'),
