('76', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Asus ZenFone A450CG это смартфон нового поколения, выполненный на базе Android 4.4. Высокое качество его работы обеспечивает процессор Intel Atom Z2520 с параметрами 1200 МГц и 2 ядра. Asus ZenFone A450CG, корпус которого сделан из пластика белого цвета, весит всего 134 грамма. Одновременно он может работать с двумя карточками Micro-SIM. Использование ускорителя графики PowerVR SGX544MP2 в Asus ZenFone A450CG предоставляет возможность смотреть фильмы в высоком разрешении. А пятидюймовый емкостной экран с технологией IPS и параметрами 854x480 дает различать до 16 млн.цветов. В телефона встроена память емкостью 8 Гб, а в слот типа microSD можно добавить еще 64 Гб. На корпусе Asus ZenFone A450CG присутствуют две камеры на 8 и 0,3 мегапикселя, также есть встроенная светодиодная вспышка, позволяющая делать фотографии в ночное время. Максимальное разрешение фото составляет 3264x2448, а видео - 1920x1080.'),
