('78', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Красота и элегантность смартфона Asus ZenFone 5 достигается за счет золотистого цвета его пластикового корпуса. Качественный процессор Qualcomm MSM8926 и 4 ядра обеспечивают быструю работу с документами и дают возможность использовать смартфон для игр. IPS-экран на пяти дюймах показывает разрешение 1280х720, что гарантирует возможность различать до 16 млн. цветов. Память, встроенная в телефон, составляет 16 Гб, но ее можно дополнить 64 Гб при помощи microSD. Корпус телефона содержит две камеры на 8 и 2 мегапикселя, также имеется встроенная светодиодная вспышка, позволяющая делать фотографии в ночное время. Максимальное разрешение фото составляет 3264x2448, а видео - 1920x1080. Есть также возможность подключения Bluetooth и в наличии функции GPS, A-GPS. Продолжительность работы при активном использовании составляет 20 часов, это обеспечивает аккумулятор Li-Ion с параметром емкости 2110 мАч.'),
