('79', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Samsung SM-G920 Galaxy S6 edge использование металла и стекла сделали телефон очень привлекательным с имиджевой точки зрения. Передняя и задняя часть Galaxy S6 покрыты Gorilla Glass 4, что делает его максимально защищенным от царапин. Телефон получил UFC-накопители объемом 32, 64 и 128 Гб. Этот стандарт памяти позволяет обрабатывать данные более чем в 10 раз быстрее, а также потребляет на 50% меньше энергии. У Galaxy S6 edge восьмиядерный CPU Exynos 7420. Он создан на основе 14-нм техпроцесса, а его разрядность составила 64 бита. В него встроена графика Mali-T760. Теперь нет необходимости покупать дополнительную заднюю крышку, возможность подзаряжаться с помощью магнитной индукции уже встроена в флагман. Достаточно приобрести любую стандартную подставку для беспроводной зарядки. Смартфон имеет окантовку из алюминия, благодаря чему его очень удобно и приятно держать в руке. Две загнутых грани экрана придают футуристический дизайн.'),
