('83', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Популярные приложения делают жизнь намного интереснее. Загружайте любимые приложения, включая популярные ВКонтакте, Одноклассники, Telegram, и Мобильный агент. Для любителей интернет-серфинга — браузер Opera. Также к вашим услугам сторонние магазины приложений Android, например предустановленный Яндекс.Store. Новейший процессор Snapdragon и 1 ГБ оперативной памяти обеспечат быструю работу приложений, а 4 ГБ встроенной памяти и возможность ее расширения еще на 32 ГБ предоставят достаточно места для них. Поддерживайте связь всеми доступными способами, используя Skype, OneDrive и Outlook — популярные приложения от Microsoft, предустановленные в Nokia X2 Две Сим-карты. Для удобного общения с друзьями и близкими приложение Skype предлагает бесплатный чат и бесплатную видеосвязь с помощью фронтальной камеры. Загружайте свои фотографии и файлы в хранилище OneDrive (бесплатно более 7 ГБ памяти) и получайте к ним доступ со смартфона, приставки Xbox или компьютера. Интерфейс Fastlane, доступный только на смартфонах Nokia, обеспечивает плавное и удобное переключение между приложениями. Их вызов осуществляется с настраиваемого рабочего стола одним движением пальца.'),
