('84', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Расширенные возможности персонализации на Lumia 730. Две Сим-карты с Windows Phone 8.1 — установите любимые фоновые изображения рабочего стола и откройте настраиваемые живые иконки с совершенно новой для себя стороны. Живые иконки — эксклюзивная особенность Windows Phone — позволят вам оставаться в курсе всех важнейших событий. Для централизованного просмотра всех уведомлений используйте «Центр уведомлений». Для постоянного бесплатного доступа к любимым фото и видеороликам или важным документам — используйте синхронизацию с облаком OneDrive.'),
