('85', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Настраиваемый главный экран Nokia X отличает традиционное качество и передовой дизайн, а благодаря яркому «плиточному» интерфейсу, характерному для смартфонов Lumia, он позволяет разместить иконки приложений удобным для вас образом. Быстрый удобный доступ к любимым приложениям с помощью Fastlane. Этот журнал, представленный только на смартфонах Nokia, обеспечивает мгновенный доступ к последним открытым приложениям, фотографиям, сообщениям на Facebook и другому контенту на одном экране.'),
