('86', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Тонкий стильный смартфон Nokia Lumia 830 идеально подходит для всех, кто любит общение. Благодаря ему владелец в любой момент сможет получить доступ ко всем ресурсам интернета, активно пользоваться социальными сетями. Металлический корпус смартфона не только солидно выглядит, но и прекрасно лежит в руке. Высокопроизводительный четырехъядерный процессор Qualcomm Snapdragon 400 и 1 ГБ оперативной памяти позволяют быстро запускать любые приложения, обеспечивают их стабильную работу. Изображение на 5-дюймовом экране с разрешением 1280 х 720 пикселей остается ярким, четким, разборчивым даже при прямом солнечном освещении. Информационный сайт, фотография, кадры фильма, игра – на экране Nokia Lumia 830 все выглядит великолепно!'),
