('88', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Смартфон LG D856 G3 Dual оснащен потрясающим дисплеем QHD с плотностью пикселей 538 точек на дюйм — подобный уровень детализации соответствует качеству полиграфии коллекционного артбука. Дисплей диагональю 5.46 дюймов обеспечивает сверхчёткое и невероятно яркое изображение разрешением 2560х1440. Ультратонкая рамка вокруг дисплея, экран занимает 76,4 процента поверхности смартфона: изображение буквально оживает в вашей руке! Благодаря использованию простых жестов и автоматической адаптации размера кнопок смарт-клавиатуры, набирать текст стало еще удобней и быстрее, а количество ошибок свелось к минимуму.'),
