('92', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Дизайн HTC One M8 DS впечатляет. Высококачественный корпус, целиком выполненный из алюминия, плавно переходит в 5-дюймовый экран Full HD. Элегантный смартфон органично ложится в руку благодаря зауженным краям и плавным линиям корпуса. Смартфон оснащенный четырехъядерным процессором Qualcomm Snapdragon 801, интегрированной поддержкой сети 4G (LTE) и работает под управлением операционной системы Android с лаконичным фирменным интерфейсом HTC Sense 6. HTC One M8 DS оснащен камерой Duo Camera с революционным модулем HTC UltraPixel, двойной разноцветной вспышкой и возможностью записи видео в формате Full HD. Ну, а любители автопортретов в жанре «селфи» по достоинству оценят широкоугольную фронтальную 5-мегапиксельную камеру.'),
