('94', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'HTC Desire 210 - смартфон от одного из лидеров рынка мобильных телефонов, очень доступный гаджет начального уровня устройств. Управляется смартфон операционной системой Android 4.2 Jelly Bean с интерфейсом Sense и включает в себя 4-дюймовый дисплей с разрешением 800 х 480 пикселей, 1 ГГц двухъядерный процессор в паре с 512 Мб оперативной памяти. Есть 4 Гб внутренней памяти, который можно расширить с помощью карт памяти MicroSD до 32 Гб. Также стоит отметить, что поддерживается такая небезынтересная функция как HTC BlinkFeed - сервис для настройки персонализированного новостного фида. Он позволяет постоянно быть в курсе текущих событий, получать сообщения в социальных сетях и блогах, следить за множеством Интернет-ресурсов и т.д. - и все это в одном месте. Отобрав из всего информационного потока (более 10 000 источников) только интересующую пользователя информацию, он получает удобный инструмент, позволяющий экономить время и при этом не пропускать ничего интересного.'),
