('96', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Со смартфоном Xperia Z3 вы сможете делать то, чего не могли позволить себе раньше — фотографировать и снимать под дождем или даже на глубине бассейна. Благодаря наивысшему уровню водостойкости* вода вашему смартфону больше не страшна. Помимо надежности, ультратонкий алюминиевый каркас придает Xperia Z3 утонченности и изысканности. Смартфон также поддерживает режим работы двух сим карт. C технологией PS4 Remote Play вы сможете ощутить весь азарт игр для PS4 на смартфоне. Просто подключитесь к консоли PS4 через домашнюю сеть Wi-Fi и играйте в любимые игры из любой комнаты с контроллером DUALSHOCK 4. В Xperia Z3 передовые разработки Sony сочетаются с игровыми технологиями. Благодаря сверхъяркому дисплею и технологии цифрового шумоподавления вы погрузитесь в виртуальный мир с головой.'),
