('98', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Xperia Z1 Compact объединяет в себе все функции смартфона премиум-класса. Он отличается красотой исполнения и идеально умещается в ладони. Снимайте удивительно красивые фотографии и видео с помощью технологий наших компактных цифровых камер. Без труда перемещайте все важное содержимое со старого устройства на смартфон Xperia Z1 Compact с помощью приложения Xperia™ Transfer. И самое главное: Xperia Z1 Compact является водостойким* и выпускается в различном цветовом исполнении.'),
