('99', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Хотите использовать все возможности смартфона Sony? Встречайте наш смартфон с двумя сим-картами Xperia E1 Dual. Xperia E1 Dual обладает характерным дизайном Sony и предназначен для активного образа жизни. Добро пожаловать в мир смартфонов с первоклассным интерфейсом, молниеносной скоростью работы процессора, продолжительным временем работы от аккумулятора и исключительными возможностями прослушивания музыки через приложение Walkman™.'),
