('100', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Sony Xperia M2 Aqua - тонкий, красивый смартфон с современной технической «начинкой». Он подарит вам легкость общения как при обычных звонках, так и в социальных сетях. Четырехъядерный процессор и мощный видеоускоритель обеспечат отличную производительность разных приложений и игр. Огромный сенсорный дисплей с диагональю 4.8 дюймов подарит комфортный ввод данных и просмотр видеороликов и фильмов. Вы можете плавать с ним в пресной воде до 30 минут и даже нырять на глубину до 1,5 метра. Бассейн уже ждет вас! Плещитесь в воде, не расставаясь с 8-мегапиксельной камерой, и снимайте даже под водой: для этого на телефоне предусмотрена специальная удобная клавиша камеры. А еще можно заснять ваши развлечения на видео, чтобы позже, пересматривая ролики и вспоминая, вновь ощутить волну летней свежести.'),
