('102', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Смартфон Lenovo P70 Dark Blue (темно-синий) подходит как для бизнеса, так и для повседневных нужд. Работает гаджет под управлением системы Android OS 4.4 и оснащен процессором MediaTek MT6752, имеющим 8 ядер. Размер оперативной памяти составляет 2048Mb. Процессор работает на частоте 1700 МГц. Качественная IPS-матрица Lenovo P70 передает все цвета и краски в естественном виде, а благодаря 5-дюймовому дисплею можно наслаждаться играми и фильмами в дороге. Смартфон имеет 16 гигабайт встроенной памяти и слот для расширения до 32 гигабайт. Приятным бонусом является тыловая камера на 13 мегапикселей, фронтальная камера способна делать снимки в 5 мегапикселей. Также смартфон может похвастать двумя слотами для micro-sim, емким аккумулятором на 4000 миллиампер часов, а также работой в сетях 4G (LTE).'),
