('103', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Пятидюймовый Lenovo S90 представляет собой стильный фаблет, выполненный в корпусе из металла цвета серый металлик. Работает устройство на Android 4.4 Kitkat. Есть поддержка Micro-Sim card (2 слота). Яркий дисплей Super Amoled (1280x720) позволит смотреть фильмы в HD качестве, а процессор Qualcomm Snapdragon 410, работающий на частоте 1200 МГц и видеочип Adreno 306, а также оперативная память на 2 Гб идеальная комбинация – для тех, кто любит играть в мобильные игры. Смартфон оснащен камерой 13 мегапикселей со светодиодной вспышкой, фронтальная камера на 8 мегапикселей. В то же время Lenovo S90 отличается легкостью, вес модели составляет всего 129 грамм. И конечно же, встроенная память на 32 Гб и работа в 4G сетях – для самого интересного времяпрепровождения.'),
