('104', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'В компактном Lenovo A319 (черный) уместился не только современный mp3-плеер, который работает на технологии Dolby Digital Plus, но и дополнительный слот для второй sim-карты, а также слот для увеличения памяти до 32 Гб. Само устройство оснащено Mediatek MT6572. Процессор работает на частоте 1300 МГц. Что же до версии системы Android, то здесь пользователю дана новая 4.4 kitkat. Lenovo A319 имеет небольшой 4-х дюймовый экран, разрешение которого составляет 480x800. Основная камера имеет 5 Мп, фронтальная 2 Мп. Также на борту устройства 4 Гб встроенной памяти, оперативная память составляет 512 Мб.'),
