('105', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'Мощный четырехъядерный процессор избавит вас от необходимости ждать открытия приложений или вывода на экран изображений. Высокая эффективность в мультизадачном режиме обеспечивает четкую и быструю работу смартфона. Android 4.2 создает все условия для раскрытия многозадачности процессора, позволяя вам легко управлять своим смартфоном и настраивать его в соответствии со своими потребностями.'),
