('91', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'LG Leon LGH324 - смартфон с 4.5-дюймовым экраном. Он имеет четырехъядерный процессор с тактовой частотой 1.3 ГГц, 8 ГБ встроенной памяти, 5-мегапиксельную основную камеру и 0.3-мегапиксельную фронтальную. Помимо этого, смартфон оснащен беспроводными модулями Wi-Fi, Bluetooth и работает под управлением Android 5.0 Lollipop. Внутри смартфона установлен аккумулятор ёмкостью 1900 мА*ч.'),
