('106', '0b2bc82e-1dc7-4a72-934a-df2fdb1d8dd9', '\r\n\r\nНачальная стоимость этого товара равна 15 000 руб.\r\n  На калькулятор действует постоянная скидка в 25% через глобальный модификатор цены.\r\n\r\nВ настройках сайта можно самому выбирать какие параметры будут и как они будут выглядеть\r\n\r\nЦену для каждой опции можно указывать в разных валютах и даже процентах (от основной стоимости товара).\r\n\r\n\r\n\r\n\r\n'),
