('87', '65209415-3fdb-410e-89a5-fc5f0f08b938', 'LG G Flex2 — отличный пример красивого сочетания формы и функционала. Full HD Plastic-OLED дисплей обеспечивает четкое, реалистичное изображение, а устройство выглядит стильно и дольше держит батарею. Среди усовершенствований модели – восьмиядерный 64-битный процессор Snapdragon 810, мощность которого впечатляет так же, как и дизайн самого смартфона. Также есть поддержка сетей нового поколения 4G LTE.'),
